import React from 'react';

const Result = props => {

    const {err, date, city, temp, sunrise, sunset, pressure, wind} = props.weather

    let content = null;

    if(!err && city!=''){
        content = (
            <div>Wyszukiwanie dla miasta ${city}</div>
        )
    }


    return (
        <div className="result">
            {err ? `Nie ma w bazie miasta o nazwie ${city}` : content}
            <div>Pogoda dla miasta: {city}</div>
            <div>Data: {date}</div>
            <div>Temperatura: {temp}</div>
            <div>Wschód słońca: {sunrise}</div>
            <div>Zachód słońca: {sunset}</div>
            <div>Ciśnienie: {pressure}</div>
            <div>Wiatr: {wind}</div>
        </div>
    )
}

export default Result;
